// @ts-ignore
import MobileMenuIcon from "./../../Assets/hamburger-menu.png";

const MobileHeader = () => {
  return (
    <div>
        <div className="HeaderNavbarMobile">
          <button className="HeaderNavbarMobileButton">
            <img
              src={MobileMenuIcon}
              alt="menu"
              className="HeaderNavbarMobileButtonImage"
            />
          </button>
        </div>
    </div>
  )
}

export default MobileHeader
